import React from "react";
import { Jumbotron } from "react-bootstrap";
import { Container } from "react-bootstrap";

const home = () => {
  return (
    <Jumbotron
      style={{
        "background-image":
          "http://greenbillion.org/wp-content/uploads/2014/11/UCLA_Hedrick-View-Mod-4.jpg",
      }}
      fluid
    >
      <Container></Container>
    </Jumbotron>
  );
};

export default home;
